import './App.css';
import { Route, Routes } from 'react-router';
import Home from './pages/Home';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route index element={<Home/>}/>
        <Route exact path="/details/:id"/>
      </Routes>
    </div>
  );
}

export default App;
